/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trn_log_blank_cutting_AFTER_INSERT` AFTER INSERT ON `trn_log_blank_cutting` FOR EACH ROW BEGIN
update mst_hot_die_steel
set numLength = numLength - new.numFinishLength,
	numLogWt = numLogWt - (numLogWt/numLength)*new.numFinishLength
where txtLogno = new.txtLogno;
update mst_die set  txtDieStatus ='Under Manufacturing' where txtDieNo=new.txtDieNo;
update mst_die_comp set txtCompStatus='Under Manufacturing' where txtDieNo=new.txtDieNo and txtCompName=new.txtComponent;
END */;;
